(43, 'مشاهدة فيلم The Seven Swords 2019 مترجم', 'مشاهدة وتحميل فيلم ال The Seven Swords 2019 مترجم بجودة HD كامل أون لاين. من بين سبعة سيوف خارقة تستحوذ قبيلة شيندو على خمسة منهم ويتبقى اثنان لدي لينغ فينغ وتلميذته يدور الصراع على السيطرة على العالم عن طريق الحصول على السبع سيوف معاً.', 'the-seven-swords-2019', 'uploads/231228441369.jpg', 0, 'HD', 0, 1, 43, '2019-04-09 14:06:40', '2019-04-09 14:07:29'),
(44, 'مشاهدة فيلم No One Would Tell 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما No One Would Tell 2018 مترجم بجودة HDTV كامل اون لاين. مئخوذ من قصة حقيقية. ويترتب على ذلك رواية حياة حقيقية لطالب في المدرسة الثانوية يبلغ من العمر 16 عامًا يدعى جيمي فولر ، والذي قتل صديقته البالغة من العمر 14 عامًا ، أيمي كارنيفال. وكان فولر غيور جدا ومسيئة تجاه ايمي. عندما انفصل كارنيفال معه ، لم يأخذ الأمر جيدًا. جذب فولر كارنيفال لقضاء بعض الوقت معه وأصدقائه في الغابة. عندما كان فولر بمفرده في الغابة مع كارنيفال ، ورد أنه طعنها 10 مرات وكسر حنجرتها. قتل كارنيفال في 23 أغسطس 1991 ، في بيفرلي ، ماساتشوستس.', 'no-one-would-tell-2018', 'uploads/24381865249.jpg', 6.8, 'HDTV', 0, 1, 44, '2019-04-09 14:06:48', '2019-04-09 14:07:29'),
(45, 'فيلم Suzzanna: Buried Alive 2018 Web-dl مترجم', 'مشاهدة وتحميل فيلم اثارة و رعب Suzzanna: Buried Alive 2018 مترجم بجودة Web-dl كامل اون لاين مشاهدة فيلم Suzzanna: Bernapas...', 'suzzanna-buried-alive-2018-web-dl', 'uploads/19886756745.jpg', 7.1, 'Web-dl', 0, 1, 45, '2019-04-09 14:06:49', '2019-04-09 14:07:29'),
(46, 'مشاهدة فيلم Carga 2018 مترجم', 'مشاهدة وتحميل فيلم الدراما Carga 2018 بجودة WEB-DL مترجم اون لاين وتحميل مباشر. “شاحنة وطريق ومصير لا يُمكن التنبؤ به، وكلها تتقاطع في شبكة الاتجار بالبشر.”', 'carga-2018', 'uploads/251551277013.jpg', 5.9, 'WEB-DL', 0, 1, 46, '2019-04-09 14:06:54', '2019-04-09 14:07:29'),
